import React, { useState, useEffect } from "react";
import { Routes, Route, Link } from "react-router-dom";
import { motion } from "framer-motion";

import Home from "./pages/Home";
import DigitalLandscapes from "./pages/DigitalLandscapes";
import PlaylistLocalization from "./pages/PlaylistLocalization";
import WebVerifyExpansion from "./pages/WebVerifyExpansion";
import UnifiedAuth from "./pages/UnifiedAuth";
import WaveBackground from "./components/WaveBackground";

export default function App() {
  const [darkMode, setDarkMode] = useState(() => {
    return localStorage.getItem("theme") === "dark";
  });

  useEffect(() => {
    localStorage.setItem("theme", darkMode ? "dark" : "light");
  }, [darkMode]);

  return (
    <div
      className={`min-h-screen transition-colors duration-300 ${
        darkMode ? "bg-gray-900 text-white" : "bg-white text-gray-900"
      }`}
    >
      <WaveBackground darkMode={darkMode} />

      <div className="relative" style={{ zIndex: 10 }}>
        {/* Header with toggle */}
        <header className="flex justify-between items-center p-6">
          <div></div>
          <button
            onClick={() => setDarkMode(!darkMode)}
            className="px-4 py-2 rounded-full border border-gray-300 hover:bg-gray-100 dark:border-gray-600 dark:hover:bg-gray-800 transition-colors text-sm"
          >
            {darkMode ? "‚òÄÔ∏è" : "üåô"}
          </button>
        </header>

        {/* Main content */}
        <main className="max-w-2xl mx-auto px-6 py-20">
          <motion.div
            initial={{ opacity: 0, y: 20 }}
            animate={{ opacity: 1, y: 0 }}
            transition={{ duration: 0.6 }}
            className="text-center mb-16"
          >
            <h1 className="text-5xl font-light mb-6 tracking-wide">Yaz Liu</h1>
            <p className="text-xl text-gray-600 dark:text-gray-300 leading-relaxed max-w-lg mx-auto">
              Product designer focused on turning complexity into clarity. I
              build systems, elevate design ops, and scale meaningful
              experiences.
            </p>
          </motion.div>

          {/* Case studies grid */}
          <motion.div
            initial={{ opacity: 0 }}
            animate={{ opacity: 1 }}
            transition={{ delay: 0.3, duration: 0.6 }}
            className="space-y-8"
          >
            <Link to="/case-studies/digital-landscapes" className="block group">
              <div className="border-b border-gray-200 dark:border-gray-700 pb-6 hover:border-gray-400 transition-colors">
                <h3 className="text-lg font-medium mb-2 group-hover:text-gray-600 transition-colors">
                  Digital Landscapes
                </h3>
                <p className="text-gray-500 dark:text-gray-400 text-sm">
                  Design system and user experience
                </p>
              </div>
            </Link>

            <Link
              to="/case-studies/playlist-localization"
              className="block group"
            >
              <div className="border-b border-gray-200 dark:border-gray-700 pb-6 hover:border-gray-400 transition-colors">
                <h3 className="text-lg font-medium mb-2 group-hover:text-gray-600 transition-colors">
                  Playlist Localization
                </h3>
                <p className="text-gray-500 dark:text-gray-400 text-sm">
                  International user experience
                </p>
              </div>
            </Link>

            <Link
              to="/case-studies/webverify-expansion"
              className="block group"
            >
              <div className="border-b border-gray-200 dark:border-gray-700 pb-6 hover:border-gray-400 transition-colors">
                <h3 className="text-lg font-medium mb-2 group-hover:text-gray-600 transition-colors">
                  WebVerify i18n Expansion
                </h3>
                <p className="text-gray-500 dark:text-gray-400 text-sm">
                  CLEAR ¬∑ 2021
                </p>
              </div>
            </Link>

            <Link to="/case-studies/unified-auth" className="block group">
              <div className="border-b border-gray-200 dark:border-gray-700 pb-6 hover:border-gray-400 transition-colors">
                <h3 className="text-lg font-medium mb-2 group-hover:text-gray-600 transition-colors">
                  Unified Auth
                </h3>
                <p className="text-gray-500 dark:text-gray-400 text-sm">
                  Authentication system design
                </p>
              </div>
            </Link>
          </motion.div>

          {/* Resume link */}
          <motion.div
            initial={{ opacity: 0 }}
            animate={{ opacity: 1 }}
            transition={{ delay: 0.6, duration: 0.6 }}
            className="text-center mt-16"
          >
            <a
              href="/resume.pdf"
              download
              className="inline-block px-6 py-3 border border-gray-300 dark:border-gray-600 rounded-full text-sm hover:bg-gray-50 dark:hover:bg-gray-800 transition-colors"
            >
              Download Resume
            </a>
          </motion.div>
        </main>

        <Routes>
          <Route path="/" element={<div />} />
          <Route
            path="/case-studies/digital-landscapes"
            element={<DigitalLandscapes />}
          />
          <Route
            path="/case-studies/playlist-localization"
            element={<PlaylistLocalization />}
          />
          <Route
            path="/case-studies/webverify-expansion"
            element={<WebVerifyExpansion />}
          />
          <Route path="/case-studies/unified-auth" element={<UnifiedAuth />} />
        </Routes>
      </div>

      <footer
        className="relative text-center text-sm py-8 text-gray-400"
        style={{ zIndex: 10 }}
      >
        <p>&copy; 2025 Yaz Liu</p>
      </footer>
    </div>
  );
}
